La U.O. de Rehabilitación del Centro de Tratamiento Rizzola forma parte de la organización de servicios para actividades de rehabilitación en Italia, identificada por el DGR n° 253 del 01.02.2000 y posteriores modificaciones por parte de la Región del Véneto, aplicando las Directrices del Ministerio de Sanidad.

La intervención de rehabilitación tiene tres objetivos:
1) La recuperación de una competencia funcional que, por razones patológicas, se ha perdido;
2) La necesidad de poner una barrera a la regresión funcional intentando modificar la historia natural de las enfermedades crónico-degenerativas reduciendo los factores de riesgo y dominando su progresión;
3) La posibilidad de encontrar fórmulas facilitadoras alternativas.

description:
La intervención rehabilitadora comienza en el mismo momento en que se produce el daño. El término se define por un equilibrio preciso entre la estabilización de los resultados y la presencia de un potencial de recuperación.

La primera etapa de la rehabilitación en sentido cronológico tiene lugar en el mismo momento en que se produce la deficiencia y, por tanto, bien en la fase aguda de la enfermedad o en el establecimiento de una patología congénita o crónica.
La segunda etapa de la rehabilitación se inicia en función de las discapacidades que permanecen una vez superada la fase aguda de la enfermedad; se refiere a la fase postaguda y en ella participan tanto los centros de rehabilitación hospitalarios como los no hospitalarios, independientemente de su régimen jurídico (público o privado).
La tercera etapa requiere intervenciones sanitarias menos sistemáticas (ya que están relacionadas con una condición de discapacidad estabilizada) y, por lo tanto, practicables también en términos de tratamiento ambulatorio, dirigidas a mantener la autonomía funcional alcanzada por el sujeto y a prevenir posibles involuciones posteriores.

Fases de la intervención de rehabilitación
Las fases de la intervención rehabilitadora pueden describirse como sigue:
- Fase de prevención de los daños secundarios y de los consiguientes deterioros. En toda patología, con mayor o menor riesgo, puede desarrollarse una condición de discapacidad y, por tanto, la intervención rehabilitadora debe incluirse (con diferentes modalidades y compromiso según las distintas situaciones) ya en la fase aguda dentro del protocolo terapéutico;
- Fase de rehabilitación intensiva. Se caracteriza por una evaluación e intervenciones terapéuticas intensivas y suele situarse en la llamada fase inmediata post-aguda de la enfermedad, cuando la intervención rehabilitadora puede influir positivamente en los procesos biológicos que subyacen a la recuperación, conteniendo y reduciendo la extensión del deterioro y cuando la discapacidad es más modificable; esta fase también puede ser necesaria en situaciones de recaída y recidiva del evento patológico;
- Fase de finalización del proceso de recuperación y del proyecto de rehabilitación (rehabilitación extensiva o intermedia). Se caracteriza por diferentes modalidades en relación con la naturaleza y la tipología de la deficiencia y la discapacidad y, en cualquier caso, es tal que no requiere intervenciones intensivas;
- Fase de mantenimiento y/o prevención de la progresión de la discapacidad: se caracteriza por diferentes tipos de intervenciones de rehabilitación sanitaria generalmente integradas con actividades de rehabilitación social.

